INSERT INTO `locations` VALUES ('PGG','Gold Parking Garage (PGG)','Established in 1998, this garage is also home to the Wells Fargo FIU branch, as well the FIU One Card offices. ProntoWash carwash and detailing services are available here as well\r\n<br/><a href=\'http://parking.fiu.edu/\'>Parking</a>\r\n<br/><a href=\'http://shop.fiu.edu/onecard/index.html\'>FIU One Card</a>','25.754841854858803','-80.3720502941565','','mmc',1300),('PGB','Blue Parking Garage (PGB)','Established in 2002, this parking garage is often used for community event parking.\r\n<br/><a href=\'http://parking.fiu.edu/\'>Parking</a>','25.753857599964135','-80.3720632636069','','mmc',945),('PPFAM','Patricia & Philip Frost Art Museum (PPFAM)','Established in 207 and redesigned in 2008, this museum is a three-story 46,000-square-foot space. It houses various collections from local and international artists. Hours: Tuesday â€“ Saturday 10AM â€“ 5PM, Sunday 12PM â€“ 5PM. Free admission.\r\n<br/><a href=\'http://thefrost.fiu.edu/\'>Patricia & Phillip Frost Art Museum</a>','25.753716555366193','-80.37308171897462','ppfam.jpg','mmc',500),('MARC','Management and Advanced Research Center (MARC)','Established on 2002, this building is home to the University Management offices, the Center for the Administration of Justice, the Center for Leadership, Alumni Relations and the Jerome Bain Real Estate Institute, as well as various classrooms.\r\n','25.754513005788706','-80.3731532531956','marc.jpg','mmc',876),('PC','Charles Perry / Primera Casa (PC)','Established in 1972, this was the first building on the FIU campus. The building is an â€œOutstanding Concrete Structureâ€ that houses Administrative offices, Human Resources, Undergraduate Advising, Financial Aid, the Bursar, Admissions and Enrolment services, the Department of Earth Sciences, the Center for Internet Augmented Research &amp; Assessment (CIARA), as well as several labs and classrooms.','25.7555215294663','-80.37372143957327','pc.jpg','mmc',1900),('GC','Ernest R. Graham Center (GC)','Established in 1974, GC is home to the student art and piano lounge, a food court featuring restaurants such as Fresh Food Co., Pollo Tropical and Chiliâ€™s Too. Also found here are the offices of Student Services, student organizations, computer labs and classrooms. You can also buy various items at the mall kiosks found near the food court. You can also buy your textbooks at the <a href=\"http://shop.fiu.edu/bookstore/index.html\">Barnes & Noble</a> bookstore.\r\n','25.7562811721849','-80.37269283329019','gc.jpg','mmc',2572),('DM','Deuxieme Maison (DM)','Established in 1972, this building is home to the College of Arts & Sciences, the Department of Psychology, the Department of Economics, the English Department, Global & Sociocultural Studies, the Honors College as well as several other departments and various classrooms.\r\n','25.756121421738243','-80.37458893310396','dm.jpg','mmc',1641),('GL','Steve and Dorothea Green Library (GL)','Established in 1975, this building is the largest of the campus libraries and houses the majority of FIUâ€™s research collections, including the Medical Library. Also found in GL is the Academy of the Art of Teaching, the School of Social Work, the Center for Excellence in Writing, University Technology Services, Office of Global Learning Initiatives, and the Center for Academic Success and several computer labs, group study rooms, and classrooms.\r\n','25.75716604193027','-80.37381519166668','gl.jpg','mmc',2358),('LVN','Lakeview Housing North (LVN)','Established in 2006, Lakeview Village North serves as campus housing.  Amenities include: 24-hour front desk, laundry facilities, 10 study/social lounged, seminar rooms and Wi-Fi lounges.\r\n<br/><a href=\'http://www.housing.fiu.edu/\'>Housing</a>','25.754437238722197','-80.37467927721774','lvn.jpg','mmc',442),('LVS','Lakeview Housing South (LVS)','Established in 2006, Lakeview Village South serves as campus housing.  Amenities include: 24-hour front desk, laundry facilities, 10 study/social lounged, seminar rooms and Wi-Fi lounges.\r\n<br/><a href=\'http://www.housing.fiu.edu/\'>Housing</a>','25.753917531156947','-80.37432714089356','lvs.jpg','mmc',412),('EH','Everglades Residence Hall (EH)','Established in 2002, Everglades Hall serves as campus housing.  Amenities include: 24-hour front desk, laundry facilities, five study/social lounged, a seminar room and Wi-Fi lounges.\r\n<br/><a href=\'http://www.housing.fiu.edu/\'>Housing</a>','25.753754390718427','-80.37532880662495','eh.jpg','mmc',573),('PH','Panther Residence Hall (PH)','Panther Residence Hall opened its doors to students in 1992, and includes four study/social lounged, building-wide Wi-Fi, a laundry facility, a 24-hour front desk and three community kitchens.\r\n<br/><a href=\'http://www.housing.fiu.edu/\'>Panther Residence Hall</a>','25.753996939977934','-80.3763903495491','ph.jpg','mmc',545),('UT','University Towers (UT)','Established in 2000, the University Park Towers serve as campus housing and feature five study/social lounged, an on-site laundry facility, a 24-hour front desk and Wi-Fi lounges. For a quick snack or your last-minute needs, stop by the C3 Express Breezeway CafÃ© POD.\r\n','25.754831252037263','-80.37567261719869','ut.jpg','mmc',628),('FIUS','FIU Community Stadium (FIUS)','Established in 1985 , this stadium serves as the home of the Panthers football team.<br/>\r\nThe R. Kirk Landon Fieldhouse  here houses the University Credit Union Box Office, Football offices and weight room.<br/>\r\n<br/><a href=\'http://en.wikipedia.org/wiki/FIU_Stadium\'>Wikipedia - FIU Stadium</a><br/>\r\n<a href=\'http://FIUsports.com\'>FIU Sports</a>','25.75243524368879','-80.37793815203327','fius.jpg','mmc',1601),('WPAC','Herbert and Nicole Wertheim Performing Arts Center (WPAC)','Established in 1996, this building houses the Department of Theater, the School of Music, the Theatre & Dance Box Office, a 600-seat concert hall and a 150-seat recital hall, as well as various various classrooms, studios.\r\n<br/><a href=\'http://www2.fiu.edu/~ims/tour/wertheim.html\'>Herbert and Nicole Wertheim Performing Arts Center</a>','25.75253980271561','-80.37265342384839','wpac.jpg','mmc',905),('RH','Ronald W. Reagan Presidential House (RH)','Opened in 2001, the second floor of this two-story building serves as housing for the university president and his family while the ground floor acts as an events center for the university community.\r\n<br/><a href=\'http://president.fiu.edu/about/reagan\'>Ronald W. Reagan Presidential House</a>','25.755500528030407','-80.36944780727161','rh.jpg','mmc',304),('GH1','Phi Gamma Delta (GH1)','The FIU Greek fraternity housing area consists of the FIJI house (est. Fall 2001) and the Pi Kappa Alpha house (est. Spring 2005).\r\n<br/><a href=\'http://www2.fiu.edu/~greeks/housing.html\'>Housing</a>','25.753877534756477','-80.36958166432328','gh1.jpg','mmc',294),('GH2','Pi Kappa Alpha (GH2)','The FIU Greek fraternity housing area consists of the FIJI house (est. Fall 2001) and the Pi Kappa Alpha house (est. Spring 2005).\r\n<br/><a href=\'http://www2.fiu.edu/~greeks/housing.html\'>Housing</a>','25.75359408127629','-80.36991040030085','gh2.jpg','mmc',248),('OE','Owa Ehan (OE)','Established in 1977, this building is home to the Department of Biological Sciences, the National Resource Center on Nutrition, Physical Activity & Aging, the Southeast Environmental Research Center (SERC), as well as various offices, student labs and classrooms.\r\n','25.75807933237245','-80.37287427025734','oe.jpg','mmc',1311),('CP','Chemistry & Physics (CP)','Established in 1991, this building is home to offices of the Department of Chemistry & Physics, Astronomy, the International Forensic Research Institute, Scientific Receiving, as well as student labs and various classrooms.\r\n','25.758482092352164','-80.37222486182165','cp.jpg','mmc',1471),('ECS','Engineering & Computer Science (ECS)','Established in 1990, this building is home to the School of Computer Science, Department of Environmental Science, the School of Computer Science, the College of Arts & Sciences, the Advanced Materials Engineering Research Institute,  the High Performance Database Research Center (HPDRC), the Southern Technology Application Center (STAC), as well as several student labs and classrooms.\r\n','25.758989401033716','-80.37387632256844','ecs.jpg','mmc',1407),('VH','Viertes Haus (VH)','Established in 1975, VH houses the Department of Dance, Art & Art History, the Center for the Study of Matter at Extreme Conditions (CeSMEC), the Photo Lab, the Stable Isotope Lab as well as various studios and classrooms\r\n','25.757949186750004','-80.37464316586896','vh.jpg','mmc',1122),('CU','Central Utilities (CU)','Central Utilities is home to the the Chiller Plant site. This is where chilled water is manufactured and then transported throughout the campus to each facility where it is used for air conditioning.\r\n','25.758002682107332','-80.37510141082548','','mmc',341),('PGR','Red Parking Garage (PGR)','Parking garage. ProntoWash carwash and detailing services are available here.\r\n<br/><a href=\'http://parking.fiu.edu/\'>Parking</a>','25.76014875888511','-80.3730875949094','','mmc',1136),('PG5','Market Station (PG5)','Established in 2010, PG5 is one of the most diverse buildings on campus. It is a parking garage; a collection of classrooms and a food court - with Wi-Fi and televisions - that seats 300. Public Safety and Parking & Transportation services as well as the FIU Faculty Group Practice can be found here.\r\n','25.760141600415828','-80.37155860229984','pg5.jpg','mmc',1489),('AHC1','Academic Health Center 1 (AHC1)','Part of the Academic Health Sciences Complex, established in 2008, this building is home to offices of the School of Public Health offices, the College of Nursing & Health Science and the College of Health & Urban Affairs. Classrooms and students labs can also be found here.','25.757624062193862','-80.37132725117887','ahc1.jpg','mmc',951),('UA1','University Apartments (UA)','These two-story courtyard-style apartments were established in 1986 as the first housing area on the MMC  (then called UP) campus. These apartments are home to approximately 584 residents.\r\n<br/><a href=\'http://www.housing.fiu.edu/Buildings/University-Park-Apartments.html\'>University Apartments</a>','25.75870590979151','-80.37033699969724','ua.jpg','mmc',168),('UA2','University Apartments (UA)','These two-story courtyard-style apartments were established in 1986 as the first housing area on the MMC  (then called UP) campus. These apartments are home to approximately 584 residents.\r\n<br/><a href=\'http://www.housing.fiu.edu/Buildings/University-Park-Apartments.html\'>University Apartments</a>','25.758621560699915','-80.36984952093277','ua.jpg','mmc',87),('UA3','University Apartments (UA)','These two-story courtyard-style apartments were established in 1986 as the first housing area on the MMC  (then called UP) campus. These apartments are home to approximately 584 residents.\r\n<br/><a href=\'http://www.housing.fiu.edu/Buildings/University-Park-Apartments.html\'>University Apartments</a>','25.758665718002028','-80.36938797301656','ua.jpg','mmc',53),('UA4','University Apartments (UA)','These two-story courtyard-style apartments were established in 1986 as the first housing area on the MMC  (then called UP) campus. These apartments are home to approximately 584 residents.\r\n<br/><a href=\'http://www.housing.fiu.edu/Buildings/University-Park-Apartments.html\'>University Apartments</a>','25.75875089034389','-80.368996057782','ua.jpg','mmc',43),('UA5','University Apartments (UA)','These two-story courtyard-style apartments were established in 1986 as the first housing area on the MMC  (then called UP) campus. These apartments are home to approximately 584 residents.\r\n<br/><a href=\'http://www.housing.fiu.edu/Buildings/University-Park-Apartments.html\'>University Apartments</a>','2